import styled from "styled-components"
import { Link } from "react-scroll"

const Links = () => {
  return (
    <Background>
      <Link to="2" spy={true} smooth={true}>
        <LinkItem>소개</LinkItem>
      </Link>
      <Link to="3" spy={true} smooth={true}>
        <LinkItem>성장</LinkItem>
      </Link>
      <Link to="4" spy={true} smooth={true}>
        <LinkItem>진화</LinkItem>
      </Link>
      <Link to="5" spy={true} smooth={true}>
        <LinkItem>기능</LinkItem>
      </Link>
    </Background>
  )
}

export default Links

const Background = styled.div`
  display: flex;
  height: 20vh;
  background: white;
  justify-content: center;
`

const LinkItem = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  width: 17vw;
  height: 100%;
  background: white;
  cursor: potiner;
  &:hover {
    background: lightgrey;
    color: #6c9cf5;
    font-weight: bold;
  }
  color: black;
  margin: 0 1rem;
  font-size: 30px;
`
